input = <<EOS





EOS

paths = {
  1 => {D: 3},
  2 => {D: 6, R: 3},
  3 => {U: 1, D: 7, L: 2, R: 4},
  4 => {D: 8, L: 3},
  5 => {R: 6},
  6 => {U: 2, D: :A, L: 5, R: 7},
  7 => {U: 3, D: :B , L: 6, R: 8},
  8 => {U: 4, D: :C , L: 7, R: 9},
  9 => {L: 8},
  A: {U: 6, R: :B},
  B: {U: 7, D: :D , L: :A, R: :C},
  C: {U: 8, L: :B},
  D: {U: :B},
}

code = ''
pos = 5

input.strip.split("\n").each do |line|
  line.each_char.map(&:to_sym).each do |c|
    pos = paths[pos][c] if paths[pos].key?(c)
  end
  code += pos.to_s
end

puts code
